package java01;

public class ComparisonOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x = 3;
		int y = 4;
		System.out.println(x == y);// False
		System.out.println(x != y);// True
		System.out.println(x > y);// False
		System.out.println(x < y);// True
		System.out.println(x <= y);// True

	}

}
